import React, { Component } from 'react';
import frame from './frame.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div><input wi></input></div>
        <div><img src={frame}/></div>
        <img src="https://s3.eu-central-1.amazonaws.com/periodica-main/public/photo_dpi72.jpg"  />
      </div>
    );
  }
}

export default App;
